MongoDB - $substr on all strings in an array<p>I have this aggregation, designed to find values that start with a given query and then prioritize exact matches in the results. The <code>tags</code> field is an array that contains 1 or more strings.</p>
<pre><code>results = await Post.aggregate([

    // Find all tags that begin with the given query
    { $match: { 'tags': new RegExp(&quot;^&quot; + query, 'i') } },

    { $addFields: {
        // Add a field 'true' where one of the string values is an exact match of the query
        'exactMatch': { $eq: [ '$tags', query ] },

        // Add a field 'true' where the first 3 characters of one of the string values match the query
        'startsWith': { $eq: [ { $substr: [ '$tags', 0, 3 ] }, query ] },
    } },

    // Prioritize exact matches first
    { $sort: { 'exactMatch': -1, 'startsWith': -1 } },

    // Remove the added fields from results
    { $project: { 'exactMatch': 0, 'startsWith': 0 } }
])
</code></pre>
<p>This works perfectly when the <code>tags</code> field is a single string, however I am trying to do this now with an array of strings.</p>
<p>The problem lies within this line of code:</p>
<pre><code>// Add a field 'true' where the first 3 characters of one of the string values match the query
'startsWith': { $eq: [ { $substr: [ '$tags', 0, 3 ] }, query ] },
</code></pre>
<p>Due to the <code>tags</code> field being an array, the <code>$substr</code> function is invalid and produces this error:</p>
<blockquote>
<p>MongoServerError: PlanExecutor error during aggregation :: caused by :: can't convert from BSON type array to String</p>
</blockquote>
<p>How can I convert this line of code to target all values within the array, rather than the array itself?</p>
<p><strong>(Edit) Sample data, input &amp; expected results</strong></p>
<p>With the following data:</p>
<pre><code>[
    {
        title: 'Post1',
        content: 'This is test post 1.',
        tags: [
            'post', '12345'
        ]
    },
    {
        title: 'Post2',
        content: 'This is test post 2.',
        tags: [
            'post', '789'
        ]
    },
    {
        title: 'Post3',
        content: 'This is test post 3.',
        tags: [
            'post', '123'
        ]
    }
]
</code></pre>
<p>And an input query of &quot;123&quot; I would expect to see the following results:</p>
<pre><code>[
    {
        title: 'Post3',
        content: 'This is test post 3.',
        tags: [
            'post', '123'
        ]
    },
    {
        title: 'Post1',
        content: 'This is test post 1.',
        tags: [
            'post', '12345'
        ]
    }
]
</code></pre>

